        color: 'white',
        py: 2 // padding top and bottom
      }}>
      <Box maxWidth="lg" justifyContent="center">
        <Toolbar sx={{width: '70vw'}}>
          <Typography variant="body1" align="left" sx={{fontFamily: 'var(--font-family-ibm-plex-mono)'}}>
            Built in React Â© Nelson Rodriguez 2024
          </Typography>
        </Toolbar>
      </Box>
    </AppBar>
  );
};

export default Footer;
